import React from 'react';


function CartItem({id, product, price, qty}) {
    return (
        <div className="CartItem">
            <div>{product}</div>
            <div>${price}</div>
            <div>
                <button>-</button>
                {qty}</div>
                <button>+</button>
            <div>Total: {qty * price}</div>
        </div>
    )
}
    

export default CartItem;
